import React from 'react'
import Todo from './Todo.js'
function TodoItem(todos) {
    console.log(todos)

    return (
        <div>
            {todos.map((todo) => (
                <Todo key={todo.id}> {todo.title} </Todo>
            ))}
        </div>
    )
}
export default TodoItem
